var b="url",c="售货机型号.html",d="generationDate",e=new Date(1480515778356.13),f="isCanvasEnabled",g=false,h="isAdaptiveEnabled",i="variables",j="OnLoadVariable",k="page",l="packageId",m="9a49d67225c246469567d99c07214d22",n="type",o="Axure:Page",p="name",q="售货机型号",r="notes",s="Note",t="<p><span style=\"font-family:'Microsoft YaHei UI';font-weight:400;font-style:normal;\"># 新建的型号，如果已有售货机在用，则不允许修改货道尺寸，允许查看</span></p><p><span style=\"font-family:'Microsoft YaHei UI';font-weight:400;font-style:normal;\"><br></span></p><p><span style=\"font-family:'Microsoft YaHei UI';font-weight:400;font-style:normal;\">在新建型号时：</span></p><p><span style=\"font-family:'Microsoft YaHei UI';font-weight:400;font-style:normal;\">&nbsp;&nbsp; &nbsp; 1. 售货机货道行数是固定明确的，每层货道的列数可能不一样，所以“单层货道数”改为“各层货道数”，输入格式为整数，以英文逗号分隔，如：5,10,10,4,4，代表第1行有5列，第2行有10列，依次类推</span></p><p><span style=\"font-family:'Microsoft YaHei UI';font-weight:400;font-style:normal;\">&nbsp;&nbsp; &nbsp; 2. 会出现有售货机的货道不允许合并的情况，所以新建型号时需要选择此型号是否能够合并货道，不允许合并的机型在售货机管理中进行货道设置时没有“合并”“取消合并”的按钮</span></p><p><span style=\"font-family:'Microsoft YaHei UI';font-weight:400;font-style:normal;\"><br></span></p><p><span style=\"font-family:'Microsoft YaHei UI';font-weight:400;font-style:normal;\">型号基础信息完成后，弹窗设置尺寸信息：</span></p><p><span style=\"font-family:'Microsoft YaHei UI';font-weight:400;font-style:normal;\">&nbsp;&nbsp; &nbsp; 1. 尺寸单位全部为毫米</span></p><p><span style=\"font-family:'Microsoft YaHei UI';font-weight:400;font-style:normal;\">&nbsp;&nbsp; &nbsp; 2. 每行货道的“深度/高度”（2.0叫长度/高度）和摆放方式“竖/横”统一设置</span></p><p><span style=\"font-family:'Microsoft YaHei UI';font-weight:400;font-style:normal;\">&nbsp;&nbsp; &nbsp; 3. 每个货道的需要单独设置具体尺寸，包括标准宽度（毫米）、最大宽度（毫米） 、是否固定容量、固定容量数（作用见货道设置逻辑）</span></p><p><span style=\"font-family:'Microsoft YaHei UI';font-weight:400;font-style:normal;\"><br></span></p><p><span style=\"font-family:'Microsoft YaHei UI';font-weight:400;font-style:normal;\">货道设置逻辑流：</span></p><p><span style=\"font-family:'Microsoft YaHei UI';font-weight:400;font-style:normal;\">&nbsp;&nbsp; &nbsp; 1. 见流程图</span></p><p><span style=\"font-family:'Microsoft YaHei UI';font-weight:400;font-style:normal;\">&nbsp;&nbsp; &nbsp; 2. 货道合并时，将标准宽度相加作为标准宽度，将最大宽度相加作为最大宽度。</span></p>",u="style",v="baseStyle",w="627587b6038d43cca051c114ac41ad32",x="pageAlignment",y="center",z="fill",A="fillType",B="solid",C="color",D=0xFFFFFFFF,E="image",F="imageHorizontalAlignment",G="near",H="imageVerticalAlignment",I="imageRepeat",J="auto",K="favicon",L="sketchFactor",M="0",N="colorStyle",O="appliedColor",P="fontName",Q="Microsoft YaHei UI",R="borderWidth",S="adaptiveStyles",T="interactionMap",U="diagram",V="objects",W="id",X="fea5d17721db4dfab4d475c3d18082cd",Y="label",Z="",ba="friendlyType",bb="Rectangle",bc="vectorShape",bd="styleType",be="visible",bf=true,bg="fontWeight",bh="400",bi="fontStyle",bj="normal",bk="location",bl="x",bm=533,bn="y",bo=1208,bp="size",bq="width",br=342,bs="height",bt=296,bu="40519e9ec4264601bfb12c514e4f4867",bv="'Microsoft YaHei UI'",bw="imageOverrides",bx="872dca3f569f46099839ed0fc490a971",by="isContained",bz="richTextPanel",bA="paragraph",bB="generateCompound",bC="410d6a48b3624c9e8ba944fb8c55221d",bD=35,bE=0xFFF2F2F2,bF="e309e0e87b0d4d75830d4612eec5427f",bG="34ea48f421e049b4978baf8c92746ac9",bH=1469,bI="56cbe15323c142ba82efdb6cbe158383",bJ="1bea855161a74b97a18a866c2481ca70",bK=543,bL=1218,bM=73,bN=15,bO="fontSize",bP="12px",bQ="b3a15c9ddde04520be40f94c8168891e",bR="6c45859892da4ed8af9a7d9f40783bdc",bS="e5d060ba9ad343e5be01d2ae05491910",bT=160,bU=767,bV=901,bW=425,bX="a4fa9fe6a3714fbc9b155c2052716ff2",bY="f6abd84f6d4b431bbd87418bda5db8da",bZ="8a592261e5eb4ca2aec1cef0562574c1",ca="286bc446543641c8b471ab74805f2199",cb=1157,cc="9af7049d7ee7491a9b7df489b96c628b",cd="e1859763658949c3a2871709117e70bf",ce=585.5,cf=1162,cg=50,ch=25,ci="cornerRadius",cj="5",ck="fdebf5f9cc2c4b4291e10c7528bb511d",cl="ab2b0e5fc0fb4939aff65fc67e7a2cfc",cm=170,cn=777,co=49,cp="25eb7cba5eca4706817104962e479db6",cq="5e01ee9b51f644318900d19cd32513c8",cr